  - uid: 18111
    components:
    - type: MetaData
      name: пособие по крионике
    - type: Transform
      rot: 1.5707963267948966 rad
      pos: -18.240822,32.718372
      parent: 2
    - type: Paper
      content: >-
        нуэ... для самых маленьких интернов эта записка расскажет как хоть работает это ваще "крио"

                                                         глава I
                                            как работает крио?
        Крио работает при определенной температуре тела пациента. В основном для препаратов крионики нужно 213K, но есть исключение, а именно оппорозидон, который работает с 150К. Ну а сами препараты крионики нужно вставлять в криокапсулу и не забыть включить охладитель, фильтр и насос.
                                                         глава II
                                               настройка крио 
        Для начала нужно включить насос на 101 кПа, он находится возле шлюза. Далее выключить охладитель и поставить температуру,которая нужна для работы препаратов крионики.

        ( Можно ставить и меньше градусов в первый раз.)

        Далее включить фильтр и установить газ, который выдыхает пациент. В основном это диоксид углерода, но воксы выдыхают аммиак, ну а слаймолюды - оксид азота.                


                                                                                        by werj_
  - uid: 18112
    components:
    - type: MetaData
      name: пособие по конденсатору
    - type: Transform
      rot: -1.5707963267948966 rad
      pos: -33.438946,33.333447
      parent: 2
    - type: Paper
      content: "\n                                              глава I\n                       зачем же конденсатор нужен?\n\nКонденсатор, как ни странно, переделывает газы в жидкость, а далее уже можно с ними делать прикольчики которые я расписал в последующих главах.\n\n                                              глав II\n                                    применение газов\n \nЕсть два газа, которые с начала переделываются с помощью конденсатора, а далее уже их нужно электролизировать и получить реагенты. Оксид азота: переделывается за 3 унции в 2 азота и 1 кислород, а еще есть диоксид углерода из него мы получаем за 3 унции 2 кислорода 1 углерод.\nОстальные газы так и называются при конденсировании, но пар переделывается в воду!\nОсновное применение - это, конечно же, реагенты из газов, тот же углерод с диоксида. Но хочу подметить галлюциогенные свойства фрезона и усыпляющие оксида азота(если не слаймолюд) ну и самое сладкое это тритий который можно использовать в огнеметах вместо напалма, он примерно в раза 2 лучше его.\n\n                                              глава III\n                               настройка конденастора\n\nВ основном нужно просто прикрепить канистру к соединительному порту ну и включить объемный насос возле, но еще можно брать кислород с дистры и делать бесконечное кол-во криоксадона.\nДля этого ставим объемный газовый насос с дистры далее газовый фильтр, устанавливаем максимально кПа и фильтруем азот, ну а потом ставим объемный насос в сторону конденстора. Итого мы получаем +- 3к унций криоксадона за час.\n \n                                                                                                 by werj_"
