    - type: Paper
      content: >-
        [head=1]Шпаргалка по лекарствам[/head]

        [head=2]В помощь интерну[/head]

        [bold]

        Лекарство (Доза) - [color=#5aaf5f]Что лечит (каждые 5 ед. вещества)[/color] и [color=#bc575f]наносит (каждые 5 ед. вещества)[/color]


        [color=#f4b084]▀▀▀▀▀▀▀▀▀▀▀▀▀▀▀▀▀▀▀▀▀▀▀▀▀▀▀▀▀▀▀▀▀▀▀▀▀▀▀

        [head=2]Механические повреждения[/head][/color]

        [bullet][color=#ffaa00]Бикаридин[/color] (14) - [color=#5aaf5f]Механические (по 6.7 ушибов, порезов и уколов)[/color]

        [bullet][color=#ff3636]Бруизин[/color] (10.5) - [color=#5aaf5f]Сильные ушибы (по 35 ушибов)[/color]

        [bullet][color=#283332]Лацеринол[/color] (12) - [color=#5aaf5f]Сильные порезы (по 30 порезов)[/color]

        [bullet][color=#b9bf93]Пунктураз[/color] (11) - [color=#5aaf5f]Сильные уколы (по 40 уколов)[/color], [color=#bc575f]Ушибы[/color]


        [color=#d20000]!!! СМЕШИВАНИЕ ЭТИХ ЛЕКАРСТВ ДАЁТ ОПАСНЫЙ ТОКСИН  !!!

        [/color][color=#abd5d7]БРИТВИУМ[/color] -  [color=#bc575f]наносит порезы и кровотечение[/color]


        [color=#00b0f0]▀▀▀▀▀▀▀▀▀▀▀▀▀▀▀▀▀▀▀▀▀▀▀▀▀▀▀▀▀▀▀▀▀▀▀▀▀▀▀

        [head=2]Удушье и кровопотери[/head][/color]

        [bullet][color=#0044a8]Дексалин[/color] (20) - [color=#5aaf5f]Слабые удушья и кровопотери[/color] (не уровень крови)

        [bullet][color=#4da0bd]Дексалин Плюс[/color] (25) - [color=#5aaf5f]Удушья и кровопотери (по 35 удушья и 30 кровопотери)[/color] (не уровень крови)

        [bullet][color=#731024]Инапровалин[/color] (нет) - [color=#5aaf5f]Сильные удушья, только при крите (по 50 удушья)[/color]

        [bullet][color=#0064c8]Физраствор[/color] (нет) - [color=#5aaf5f]Восполняет уровень крови (по 20% уровня крови)[/color] но не кровопотерю

        [bullet][color=#ADD8E6]Эпинефрин[/color] (20) - [color=#5aaf5f]Всего понемногу, но в основном удушья, только при крите (по 30 удушья, 5 ядов 1.7 ушибов, порезов и уколов, 1.25 ожогов, омборожения, электрического и кислотного)[/color]

        [bullet][color=#434b4d]Железо[/color] (нет) - [color=#5aaf5f]Восполняет красную кровь (будет наносить 1 ядов арахнидам)[/color]

        [bullet][color=#b05b3c]Медь[/color] (нет) - [color=#5aaf5f]Восполняет голубую кровь (будет наносить 1 ядов всем, кроме арахнидов)[/color]


        [color=#ffc000]▀▀▀▀▀▀▀▀▀▀▀▀▀▀▀▀▀▀▀▀▀▀▀▀▀▀▀▀▀▀▀▀▀▀▀▀▀▀▀

        [head=2]Физические (ожоги) повреждения[/head][/color]

        [bullet][color=#215263]Дермалин[/color] (9) - [color=#5aaf5f]Физические, без кислотных (по 15 термических, обморожений и электрических)[/color]

        [bullet][color=#bf3d19]Келотан[/color] (нет) - [color=#5aaf5f]Слабые физические, без кислотных (по 3.3 термических, обморожения и электрических)[/color]

        [bullet][color=#ff7db5]Лепоразин[/color] (нет) - [color=#5aaf5f]Сильное обморожение (по 40 обморожений)[/color], сильно повышает температуру тела до достижения 293К

        [bullet][color=#aa4308]Пиразин[/color] (20) - [color=#5aaf5f]Сильные термические (по 50 термических)[/color]

        [bullet][color=#8147ff]Инсузин[/color] (12) - [color=#5aaf5f]Сильные электрические (по 40 электрических)[/color], немного снижает температуру тела

        [bullet][color=#e0a5b9]Сигинат[/color] (16) - [color=#5aaf5f]Кислотные (по 30 кислотных)[/color]

        [bullet][color=#f4dab8]Сидерлак[/color] (нет) - [color=#5aaf5f]Сильные кислотные (по 50 кислотных)[/color]


        [color=#00b050]▀▀▀▀▀▀▀▀▀▀▀▀▀▀▀▀▀▀▀▀▀▀▀▀▀▀▀▀▀▀▀▀▀▀▀▀▀▀▀

        [head=2]Токсические повреждения[/head][/color]

        [bullet][color=#3a1d8a]Диловен[/color] (20) - [color=#5aaf5f]Слабые яды (по 10 ядов)[/color]

        [bullet][color=#22282b]Уголь[/color] (нет) - [color=#5aaf5f]Слабые яды, очистка организма от любых неусвеонных препаратов (по 10 ядов)[/color]

        [bullet][color=#64ffe6]Дифенгидрамин[/color] (нет) - [color=#5aaf5f]Сильные яды (по 30 ядов)[/color]

        [bullet][color=#2b2f77]Стеллибинин[/color] (нет) - [color=#5aaf5f]Сильные яды (по 40 ядов)[/color]

        [bullet][color=#8B4513]Ипекак[/color] (нет) - [color=#5aaf5f]Временная остановка яда (вызывает рвоту)[/color]

