      content: >-
        Поздравляем, командование NanoTrasen решило обновить минимальный охранный шаттл службы безопасности станции NT-Raven-GE до версии 12. 


        Добавлены мигалки, которые активируются по кнопке, чтобы нарушитель правопорядка услышал через космическую тишину знакомые звуки сирен.


        Так же сам шаттл был отцентрирован, чтобы он больше не уходил влево. Вместе с этим был добавлен маячок (вы его не найдёте), через него Центральное Командование всегда может отследить шаттл.


        И теперь на шатле имеются воздушные гранаты для экстренной починки шатла в случиях разгерматизации.


        Ожидаем, что вы оставите отзывы через капитана станции по поводу шаттла, чтобы получать следующие обновления.
